define({"topics" : [{"title":"Common operations","shortdesc":"\n                     <p class=\"shortdesc\">Various common operations can be performed over all items in list views, such as test   module, test cases, data sets, and\n                        interface list views.\n                     </p>\n                  ","id":"interface_list_view_common_operations","href":"TA_Help\/Topics\/Listview_common_operations.html","menu": {"hasChildren":false,},"tocID":"interface_list_view_common_operations-d46e21313","next":"interface_list_view_common_operations-d46e21313",},{"title":" Editable fields ","shortdesc":"\n                     <p class=\"shortdesc\">Editable fields in a list view row item can be edited directly in the row item or via   the <span class=\"keyword wintitle\">Edit Multiple Fields</span> dialog box.\n                     </p>\n                  ","id":"editable_fields","href":"TA_Help\/Topics\/Listview_editable_fields.html","menu": {"hasChildren":false,},"tocID":"editable_fields-d46e21382","topics":[]},{"title":"Test module list view","shortdesc":"\n                     <p class=\"shortdesc\">A test module list view displays a list of all test module contained within either the       <span class=\"ph uicontrol\">Tests</span> node or one of its subfolders. \n                     </p>\n                  ","id":"test_module_list_view","href":"TA_Help\/Topics\/Listview_TM.html","menu": {"hasChildren":false,},"tocID":"test_module_list_view-d46e21396","next":"test_module_list_view-d46e21396",},{"title":"Test case list view","shortdesc":"\n                     <p class=\"shortdesc\">A test case list view displays a list of all test cases contained in the       <span class=\"ph uicontrol\">Tests</span> node or in one of its subfolders. Various commands can be     executed within a test case list view.\n                     </p>\n                  ","id":"test_case_list_view","href":"TA_Help\/Topics\/Listview_test_case.html","menu": {"hasChildren":false,},"tocID":"test_case_list_view-d46e21452","next":"test_case_list_view-d46e21452",},{"title":"Test objective list view","shortdesc":"\n                     <p class=\"shortdesc\">A test objective list view displays a list of all test objective items contained in a     test module node.</p>\n                  ","id":"test_objective_list_view","href":"TA_Help\/Topics\/Listview_test_objective.html","menu": {"hasChildren":false,},"tocID":"test_objective_list_view-d46e21499","topics":[]},{"title":"Data set list view","shortdesc":"\n                     <p class=\"shortdesc\">A data set list view displays a list of all data set items contained within either the       <span class=\"ph uicontrol\">Data</span> node or one of its subfolders. \n                     </p>\n                  ","id":"data_set_list_view","href":"TA_Help\/Topics\/Listview_data_set.html","menu": {"hasChildren":false,},"tocID":"data_set_list_view-d46e21510","next":"data_set_list_view-d46e21510",},{"title":"Action list view","shortdesc":"\n                     <p class=\"shortdesc\">An action list view displays a list of all user-defined action contained within either     the <span class=\"ph uicontrol\">Actions</span> node or one of its subfolders. \n                     </p>\n                  ","id":"action_list_view","href":"TA_Help\/Topics\/Listview_action.html","menu": {"hasChildren":false,},"tocID":"action_list_view-d46e21538","next":"action_list_view-d46e21538",},{"title":"Interface list view","shortdesc":"\n                     <p class=\"shortdesc\">An interface list view displays a list of all interfaces contained within the       <span class=\"ph uicontrol\">Interfaces</span> node.\n                     </p>\n                  ","id":"interface_list_view","href":"TA_Help\/Topics\/Listview_interfaces.html","menu": {"hasChildren":false,},"tocID":"interface_list_view-d46e21566","topics":[]},{"title":"Interface entity list view","shortdesc":"\n                     <p class=\"shortdesc\">An interface entity list view displays a list of all interface entities contained     within either a selected interface node\n                        or one of its subfolders.\n                     </p>\n                  ","id":"interface_entity_list_view","href":"TA_Help\/Topics\/Listview_interface_entity.html","menu": {"hasChildren":false,},"tocID":"interface_entity_list_view-d46e21580","next":"interface_entity_list_view-d46e21580",},{"title":"Test suite list view","shortdesc":"\n                     <p class=\"shortdesc\">The test suite list view displays a list of all test suite items contained in a       <span class=\"ph uicontrol\">Test Suites</span> node and its subfolders.\n                     </p>\n                  ","id":"test_suite_list_view","href":"TA_Help\/Topics\/Listview_test_suite.html","menu": {"hasChildren":false,},"tocID":"test_suite_list_view-d46e21605","topics":[]},{"title":"Picture check list view","shortdesc":"\n                     <p class=\"shortdesc\">A picture check list view displays a list of all picture checks contained in the       <span class=\"ph uicontrol\">Picture Checks</span> node or one of its subfolders. \n                     </p>\n                  ","id":"picture_check_list_view","href":"TA_Help\/Topics\/Listview_picture_checks.html","menu": {"hasChildren":false,},"tocID":"picture_check_list_view-d46e21620","topics":[]},{"title":"Result list view","shortdesc":"\n                     <p class=\"shortdesc\">A results list view displays a list of all results contained within the       <span class=\"ph uicontrol\">Results</span> node, one of its subfolders, or the <span class=\"ph uicontrol\">LOCAL       RESULTS</span> node.\n                     </p>\n                  ","id":"result_list_view","href":"TA_Help\/Topics\/Listview_results.html","menu": {"hasChildren":false,},"tocID":"result_list_view-d46e21634","next":"result_list_view-d46e21634",},{"title":"Favorite list view","shortdesc":"\n                     <p class=\"shortdesc\">The favorite list view contains all items (for example, test modules, actions, data   sets, and interfaces) which you visit\n                        frequently and designate as <dfn class=\"term\">favorites</dfn> in <span class=\"ph\">TestArchitect</span>.\n                     </p>\n                  ","id":"concept_r5n_jbj_hm","href":"TA_Help\/Topics\/Listview_favorites.html","menu": {"hasChildren":false,},"tocID":"concept_r5n_jbj_hm-d46e21679","next":"concept_r5n_jbj_hm-d46e21679",},{"title":"Bug list view","shortdesc":"\n                     <p class=\"shortdesc\">The Bug list view displays a list of all bug items including linked and unlinked bugs.     Those bug items are contained in\n                        the <span class=\"ph uicontrol\">Bugs</span> node on the <span class=\"ph\">TestArchitect explorer tree</span>.\n                     </p>\n                  ","id":"concept_kwk_1hx_1m","href":"TA_Help\/Topics\/Listview_bug.html","menu": {"hasChildren":false,},"tocID":"concept_kwk_1hx_1m-d46e21709","topics":[]}]});